  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:57.019686\",\n\t\"name\": \"initial-survey-instructions-for-nocturnal-owl-surveys\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A large proportion of the JBH Mainland
  and Tensasillahe Island were cleared of forested habitat for agriculture.  Because
  many owls are cavity and tree nesters, it is thought that this deforestation affected
  owl populations on the Refuge.  Since inception of the refuge some forest has grown
  back, and some new trees have been planted.  The refuge sits in a flat area surrounded
  by coniferous forest, so it's deciduous trees represent a unique island of habitat.
  \ No information exists on owl distribution on the refuge.  Meanwhile barred owl
  populations are expanding, and they are just beginning to show up on the refuge.
  \ Barred owls are aggressive and have been known to displace other owls.  It is
  important to collect baseline data on owls so that we can determine whether relative
  numbers and distribution change over time, possibly due to habitat changes or the
  presence of barred owls.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
